import React, { Component } from 'react';

class Contact extends Component {
    render() {
        return (
            <React.Fragment>
                <div id="contact" className="conatiner-fluid">
                    <hr />
                    <h2 className='display-4'>Contact Me</h2>
                    <hr />

                    <div id="inputs">
                        <div className="container-fluid">
                            <form className="contact_form">
                                <h3>Get in Touch</h3>
                                <input id="name" placeholder="Name" type="text" /><br />
                                <input id="email" placeholder="Email" type="text" /><br />
                                <textarea id="name" placeholder="Message"></textarea><br />
                                <input id="submit_btn" value="Submit" />
                            </form>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default Contact;
